  if(c<=30&&c>=11) color='ffff00';
  if(c<=80&&c>=31) color='000000';
  if(c<=97&&c>=81) color='ff0000';
  if(c<=100&&c>=98) color='222222';

  goPointTo(rand(5,60)+'x'+rand(5,60), color);
}
}
